import useForm from '../lib/useForm';
import Form from './styles/Form';

export default function SearchBar() {
  const { inputs, handleChange } = useForm({
    input: '',
  });

  return (
    <Form
      placeholder="Search"
      onChangeText={handleChange}
      value={inputs}
    />
  );
}
